import React, { Component } from "react";
import Facebook from "../images/facebook-logo.png"

class Footer extends Component {
    render() {
        return (
            <footer>
              <div className="footer-container">
                <p className="footer-contact">Contactez-moi</p>
                <div className="footer-legal-mention">
                    <a href="#"><p className="footer-privacy">Politique de confidentialité</p></a>
                    <a href="#"><p className="footer-notice">Mention légales</p></a>
                    <a href="#"><p className="footer-copyright">Copyright</p></a>
                </div>
                <p className="footer-social-media">
                  <a href="#"><img
                    src={Facebook}
                    alt="facebook-logo"
                  /></a>
                  <a href="#"><img
                    src="/src/images/new-Instagram-logo-black-glyph.png"
                    alt="instagram-logo"
                  /></a>
                  <a href="#"><img
                    src="/src/images/free-linkedin-icon-112-thumb.png"
                    alt="linkedin-logo"
                  /></a>
                </p>
              </div>
            </footer>
          );
        };
    }


export default Footer;
